import React from 'react'
import { file1 } from '../../Images/2011'
const Gallery1 = () => {
    return (
        <div>
            {
                file1.map((img, index) => {
                    return (
                        <div key={index}>
                            <img src={img.src} alt='error' />
                        </div>
                    )
                })
            }
        </div>
    )
}

export default Gallery1
